import React, { Component } from 'react';
import './App.css';
import Market from './component/Market';
import Sell from './component/Sell';
import Buy from './component/Buy';

class App extends Component {
  render() {
    return (
      <div>
        <Market /><br/><br/><br/><br/>
        <main className="kolom">
        <Sell />
        <Buy />
        </main>
      </div>
    );
  }
}
export default App;
